import React, { Component } from 'react'
import Tile from './Tile.js';

export default class TileGrid extends Component {
    constructor(props) {
        super(props);
        this.state = {
          count: 0,
        };
    }

    render() {

        let countStr = this.props.count.toString();
        console.log(countStr);
        return (
            <Tile name='dog folder' image='dog' isFolder={true} /> 
        )
    }
}
